INSERT INTO `artists` (`id`, `name`, `picture`, `date`, `biography`, `playlist`) VALUES
(1, 'JeanneTo', './assets/img/artistes/jeanneto.jpg', '2024-07-05 19:00:00', 'JeanneTo chante un romantisme contemporain à la croisée des genres. Des chansons Pop, Techno et Eurodance mises en exergue par le juste tuning de Cadillacprod (Ben PLG, Asma, Te Huur). Au-delà de la vitesse, de la sincérité sur les douces vulnérabilités de la vie : relations sociales, attractions physiques, substances psychoactives… C’est touchant et émouvant, tout en restant dansant. Véritable accélérateur de particule, JeanneTo prépare un 5ème EP “RAVE POP” pour le 10 Novembre 2023 chez Floral Records.', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/playlist/37i9dQZF1DZ06evO2QDuw6?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(2, 'Juliette Armanet', './assets/img/artistes/juliette-armanet.jpg', '2024-07-05 21:00:00', 'C’est l’étincelle qui déclenche tout. Le beat disco, la note de piano, l’accord qui serre le cœur et s’empare des corps. La flamme qui embrase le deuxième album de Juliette Armanet. Brûler le feu, comme un grand incendie. Ce feu sacré, Juliette l’entretient depuis le succès de Petite Amie, son premier album double platine (200000 albums vendus) couronné par une Victoire de la Musique de l’album révélation, et d’une tournée de plus de 200 concerts, d’intimes piano-voix aux foules des plus grands festivals.', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/artist/61CPKXT0bcKj8MKTNTMOXa?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(3, 'Silk Sonic', './assets/img/artistes/silk-sonic.jpeg', '2024-07-05 23:00:00', 'Les graines de la collaboration ont été semées en 2017 lorsqu\'Anderson .Paak a fait la première partie de Bruno Mars pour la partie européenne de sa tournée mondiale 24K Magic. Une jam session tard dans la nuit sur la route a débloqué une chimie immédiate. Juste avant que le monde ne sombre dans la quarantaine, Bruno a appelé Anderson : « Tu te souviens de l\'idée qu\'on avait eue en 2017 ? Faisons-le. » Une séance en studio s\'est transformée en une collaboration de plusieurs mois, aboutissant à la « setlist de la mort ». La légende Bootsy Collins a baptisé Silk Sonic et est venue en tant qu\'« hôte spécial invité » pour An Evening With Silk Sonic, leur premier album.\r\n', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/artist/6PvvGcCY2XtUcSRld1Wilr?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(4, 'Jabba360', './assets/img/artistes/jabba360.jpg', '2024-07-06 15:00:00', '“La stabulation est un procédé où le bétail est maintenu dans un espace restreint et clos. Reste la question : sauter au-dessus du grillage ou non ?\r\n\r\nDans son procédé d’évasion, Jabba360 crée un passage vers une terre où guitares Hello Kitty et météo canadienne se retrouvent.\r\nSur ce pâturage, on reconnaît la végétation grunge de Nirvana, l’élevage croisé de The Garden, et les graines futuristes de winnterzuko. Sans s’en rendre compte, on se retrouve dans l’arche de Néo, matrixé depuis 20 ans sur le dilemme de la pilule rouge ou bleu. Alors, on se met au vert, on lâche notre surcharge mentale et on continue notre introspection.”\r\n', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/artist/7zLBAA9FIVLlV7IK686DGq?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(5, 'Jasmine Myra', './assets/img/artistes/jasmine-myra.jpg', '2024-07-06 16:00:00', 'Jasmine Myra est une saxophoniste, compositrice et cheffe d\'orchestre basée à Londres. À l\'origine membre de la scène musicale bouillonnante, créative et intergenres de Leeds (elle a fréquenté le Leeds Conservatoire), Jasmine s\'est entourée de certains des jeunes talents les plus prometteurs de la ville. Sa musique instrumentale originale a un son euphorique et inspirant, influencée par des artistes aussi variés que Kenny Wheeler, Bonobo, Ólafur Arnalds et Moses Sumney.', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/artist/3OOAxdMJCLi7iAurDghYyK?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(6, 'Kalika', './assets/img/artistes/kalika.jpg', '2024-07-06 17:00:00', 'KALIKA débarque avec son premier album « Adieu les monstres ». En guerrière pop, elle recrée le chaos de son enfance, s’interroge sur le passage au monde adulte, pour pouvoir mieux dire adieu aux monstres de son passé. Auteure, compositeure, interprète, aux textes bruts empreints de grande chanson française, cette Catherine Ringer des temps modernes affirme sur ce disque des sonorités pop à la production léchée. LA révélation scène de cette année est bien entourée du KALIKA GANG, “cette communauté qui s’est sentie à part au moins une fois dans sa vie parce qu’elle sort des cases”. Mia lorsqu’elle sort de sa coquille laisse toute la place à KALIKA. Un alter ego qu’elle a choisi pour rendre aussi bien hommage à Sara La Kali, la sainte des gitans, une communauté avec laquelle elle a grandi, qu’à la déesse hindou Kali, la divinité de la déconstruction et de la reconstruction. L’occasion donc pour elle de se débarrasser de ses monstres une bonne fois pour toutes. Car cet opus, aussi lumineux soit-il, en est rempli. Pour autant, pas question pour KALIKA de s’apitoyer sur son sort et de livrer des chansons sombres. Avec Adieu les monstres, elle entend laisser derrière elle une partie de sa vie, et transformer les mauvaises ondes en lumière. KALIKA veut simplement “reprendre le pouvoir pour se sentir plus forte”. Parmi les titres de son premier album, on trouve un duo avec l’iconique Yelle sur l’hymne « Les Glaçons », et un feat. avec Youv Dee sur le puissant titre « Personne ».', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/artist/0UgxFqJmwkpojz4mHBsRpD?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(7, 'Gogo Penguin', './assets/img/artistes/gogo-penguin.jpg', '2024-07-06 18:00:00', 'GoGo Penguin est un trio de jazz électronique britannique formé en 2012 à Manchester. Le groupe est composé de Chris Illingworth au piano, Nick Blacka à la basse et Rob Turner à la batterie. Leur musique est souvent décrite comme émouvante, cinématographique et mélodique, avec des influences de musique électronique, de break-beat et de minimalisme classique.\r\n\r\nGoGo Penguin a acquis une renommée internationale grâce à leur son unique et leur énergie live captivante. Ils ont sorti plusieurs albums acclamés par la critique, notamment \"v2.0\" (2014), \"Man Made Object\" (2016), \"A Humdrum Star\" (2018) et \"GoGo Penguin\" (2020). Leur dernier album, \"Everything Is Going to Be OK\", est prévu pour le 14 avril 2023.', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/playlist/37i9dQZF1DZ06evO0Coi4w?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(8, 'Grim Salvo', './assets/img/artistes/grim-salvo.jpg', '2024-07-06 19:00:00', 'Grim Salvo est un \"duo machiavélique\" originaire de Portland, dans l\'Oregon, composé de SLEUTH (né Patrick Jobe) et MOSSBACK (né Spencer Linn), sous la production de ³³marrow. Le trio de production est également composé de Jeremy Klein. Le duo, ainsi que Klein, font également partie du groupe The Odious avec Garrett et Austin Haag.\r\n\r\nLeur morceau le plus populaire en 2020, \"Ergot\", a gagné en popularité grâce à la chaîne YouTube \"ＴＲＡＳＨ 新 ドラゴン\", qui publie des éditions vidéo de musiques d\'anime.', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/artist/5UogEGDRYo5Q9bRIMRjuEC?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(9, 'Yamê', './assets/img/artistes/yame.jpg', '2024-07-06 20:00:00', 'Yamê est un artiste franco-camerounais né d’un père musicien et d’une mère informaticienne, deux passions dont il a hérité et qui rythment sa vie. 100% autodidacte, il lance sa carrière solo en mars 2020 après avoir débuté en tant que claviériste et chanteur dans les Jams Parisiennes. Il est décrit comme un chanteur de rap qui maîtrise les aigus avec précision. Sa mélo singulière vous transportera dans son univers truffé de métaphores souvent geek.', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/playlist/37i9dQZF1DZ06evO0eXyH9?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(10, 'Damso', './assets/img/artistes/damso.jpg', '2024-07-06 21:00:00', 'Damso est connu pour son style de rap sombre et introspectif, qui traite souvent de sujets tels que la violence, la drogue, l\'amour et la spiritualité. Il est également réputé pour ses jeux de mots et ses métaphores complexes, ainsi que pour sa voix grave et rauque.\r\nDamso est considéré comme l\'un des rappeurs les plus influents et talentueux de sa génération en France et en Belgique, et a remporté plusieurs prix et nominations, notamment aux Victoires de la Musique et aux NRJ Music Awards.\r\n\r\n', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/playlist/37i9dQZF1DZ06evO1G9baM?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(11, 'G-Flip', './assets/img/artistes/g-flip.jpg', '2024-07-06 22:00:00', 'G Flip, c\'est du vrai : sans filtre, motivé-e et sortant de sa chambre avec des idées à brûler. Ces dernières années, Georgia Flipo est passé-e du statut d\'artiste inconnu-e à celui de phénomène grand public en Australie et de talent international en pleine ascension.\r\n\r\nL\'artiste, productreurice et batteur-se, né-e à Melbourne et basé-e à Los Angeles, a conquis le cœur des fans et des médias en Australie et à l\'étranger, obtenant le soutien de Rolling Stone, VOGUE, Pitchfork, BILLBOARD et The FADER, NME, parmi d\'autres. Son plus récent album, DRUMMER, s\'est hissé à la première place du classement général des ARIA et a obtenu six nominations aux ARIA, dont celle de l\'album de l\'année et celle du meilleur artiste. \r\n\r\nÀ l\'origine, G Flip était batteur -se de studio, mais sa musique commence à la batterie. Dans ses textes, G Flip parle de relations, de chagrin d\'amour et d\'acceptation. Authentique, racontable et toujours énergique, G Flip est une véritable locomotive.', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/playlist/37i9dQZF1DZ06evO2Rn8Do?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(12, 'Girl in red', './assets/img/artistes/girl-in-red.jpg', '2024-07-06 23:00:00', 'Girl in Red est ouvertement queer et a été saluée pour sa représentation de l\'expérience LGBTQ+ dans sa musique. Son style musical est souvent décrit comme de l\'indie pop et du lo-fi, avec des influences de rock alternatif et de bedroom pop.\r\n\r\nEn 2018, Girl in Red a sorti son premier EP intitulé \"Chapter 1\", qui comprenait des chansons populaires comme \"I Wanna Be Your Girlfriend\" et \"Summer Depression\". En 2021, elle a sorti son premier album studio intitulé \"if i could make it go quiet\", qui a été acclamé par la critique et a atteint le top 10 des charts dans plusieurs pays.\r\n\r\nGirl in Red a remporté plusieurs prix et nominations, notamment aux GAFFA Awards et aux Spellemannprisen (les équivalents norvégiens des Grammy Awards), et a fait des tournées dans le monde entier pour promouvoir sa musique.', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/playlist/37i9dQZF1DZ06evO21OmAs?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(13, 'Cemented Minds', './assets/img/artistes/cemented-minds.jpg', '2024-07-07 15:00:00', 'Le ciment est un liant hydraulique, utilisé dans la préparation du béton ou dans le formatage des esprits obtus. Dans une volonté d’évasion, Cemented Minds insuffle cet esprit de liberté dont on a besoin.\r\nDans sa construction, on retrouve la légèreté de The Cure, la vitalité de Eagulls et la puissance de Holograms. Cemented Minds défend une pensée existentialiste, où le vécu humain prime face aux morales trop restrictives. Énergie post-punk, envolées de parpaings, la promesse d’être envahi par un élan de rébellion où rien ne nous arrête. Sans concession, on poursuit notre route, confiant sur nos valeurs. On libère nos esprits verrouillés et on se lâche enfin !\r\n', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/artist/57tq7bHt2vpLrwGIMpBp5v?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(14, 'Badflowers', './assets/img/artistes/badflowers.jpg', '2024-07-07 16:00:00', 'Badflower n\'a pas peur de mettre qui que ce soit mal à l\'aise. Le quatuor formé à Los Angeles et basé à Nashville - Josh Katz (chanteur et guitariste), Joey Morrow (guitariste et choriste), Alex Espiritu (bassiste) et Anthony Sonetti (batteur) - fait passer le stress, l\'insomnie, le sexe, la tristesse, la manie, la douleur et la vérité dans des hymnes alternatifs révélateurs. Après s\'être formé à Los Angeles en 2014, le groupe a sorti deux EP avant d\'envoyer une onde de choc dans tout le rock avec son premier album complet en 2019, OK, I\'M SICK, via Big Machine/John Varvatos Records. LoudWire l\'a classé parmi les \"50 meilleurs albums rock de 2019\", tandis que les singles \"The Jester\", \"Heroin\" et \"Ghost\" se sont hissés à la première place des radios rock. Sans oublier que ce dernier a obtenu une certification GOLD de la RIAA et a reçu le titre de chanson rock de l\'année aux iHeartRadio Awards. Ils sont les rares à pouvoir enflammer une foule au Kaboo Del Mar ou au Sonic Temple, en plus de partager l\'affiche avec des groupes tels que Cage the Elephant, Nothing More, Shinedown, Soundgarden et bien d\'autres. Jusqu\'à présent, ils ont également rassemblé plus de 100 millions de streams, et ce n\'est pas fini. Les singles \"30\" et \"F*ck The World\" ont atteint le Top 5 et le Top 10 des radios rock. Musicalement, les confessions frémissantes de Katz s\'infiltrent dans une distorsion culminante et, comme dans tout bon rush, on en redemande. C\'est ce qu\'ils font sur leur deuxième album, THIS IS HOW THE WORLD ENDS, emmené par le premier titre \"Family\".', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/playlist/37i9dQZF1DZ06evO2gA9WM?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(15, 'Lewis Ofman', './assets/img/artistes/lewis-ofman.jpg', '2024-07-07 17:00:00', 'Lewis OfMan est un musicien, producteur et DJ français né en 1995. Il s\'est fait connaître en 2016 avec son premier single \"Moon\", qui a été remarqué par le label Kitsuné et a été inclus dans leur compilation \"Kitsuné America 4\".\r\n\r\nDepuis lors, Lewis OfMan a sorti plusieurs EP et singles, ainsi qu\'un album intitulé \"Mi Amor\" en 2020. Sa musique est souvent décrite comme de la disco-pop, de la house et de la funk, avec des influences de musique électronique française et de synth-pop des années 80.\r\n\r\nLewis OfMan est également connu pour ses collaborations avec d\'autres artistes, notamment Her, L\'Impératrice et Juliette Armanet. Il a joué dans de nombreux festivals et clubs en France et à l\'étranger, et a été salué pour ses sets énergiques et éclectiques.\r\n\r\nEn 2021, Lewis OfMan a remporté le Prix de la révélation aux Victoires de la Musique, une des plus prestigieuses récompenses musicales en France.', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/playlist/37i9dQZF1DZ06evO0HgdLX?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(16, 'Superknova', './assets/img/artistes/superknova.jpg', '2024-07-07 18:00:00', 'SuperKnova est une artiste transgenre qui fait de la pop indie pleine d\'âme. Virtuose de l\'instrumentation, elle mêle une guitare rêveuse à une batterie électronique et à des synthétiseurs pour créer un son immédiatement familier et pourtant d\'une fraîcheur excitante. Ses paroles sincères et ses mélodies accrocheuses lui ont valu de figurer sur Work In Progress de Showtime, Fortnite d\'Epic Games, Sephora, MTV et les listes de lecture éditoriales de Spotify.\r\n\r\nMulti-instrumentiste de talent, elle produit et enregistre toute sa musique et construit nombre de ses chansons en direct sur scène, à l\'aide de boucles et d\'instruments live.\r\n\r\nElle se produit tant au niveau local que national et travaille actuellement sur son prochain album.', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/artist/7om8BpNIYHtacdW2rDVHuD?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(17, 'MUNA', './assets/img/artistes/muna.jpg', '2024-07-07 19:00:00', 'MUNA est magique. Quel autre groupe aurait pu marquer l\'année 2021 de paillettes et de pompons, vous faire chanter (et peut-être même croire) que \"Life\'s so fun, life\'s so fun\", pendant ce qui pourrait bien avoir été la période la plus difficile de votre vie ? Depuis que MUNA - la chanteuse et compositrice Katie Gavin, la guitariste, claviériste et productrice Naomi McPherson et la guitariste Josette Maskin - a commencé à faire de la musique ensemble à l\'université, à l\'USC, elles ont toujours considéré la douleur comme un fondement de la nostalgie, une partie de la croissance et un facteur inhérent à l\'expérience marginale : les membres du groupe appartiennent à des communautés queer et minoritaires, et jouent avant tout pour ces compagnons de voyage. Mais parfois, pour MUNA, après près d\'une décennie d\'amitié et une longue période d\'abandon de soi induite par une pandémie, la note la plus radicale possible est celle de la félicité.', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/playlist/37i9dQZF1DZ06evO3RlK48?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(18, 'Laylow', './assets/img/artistes/laylow.jpg', '2024-07-07 20:00:00', 'Laylow est un rappeur et producteur français né en 1993. Il s\'est fait connaître en 2016 avec sa mixtape \"Mercy\", qui a été saluée par la critique pour son style unique et son univers visuel riche.\r\n\r\nDepuis lors, Laylow a sorti plusieurs projets, notamment les mixtapes \"Fantasy\" et \"Trinity\" en 2018 et 2019, ainsi que son premier album studio \"L\'Étrange Histoire de Mr. Anderson\" en 2021. Sa musique est souvent décrite comme du rap expérimental et cinématographique, avec des influences de trap, de cloud rap et de musique électronique.\r\n\r\nLaylow est également connu pour son sens de l\'esthétique et son univers visuel, qu\'il développe à travers ses clips vidéo et ses performances live. Il a collaboré avec de nombreux artistes et producteurs français, notamment Jazzy Bazz, Nekfeu et Di-Meh.\r\n\r\nEn 2021, Laylow a remporté le Prix de la révélation de l\'année aux Victoires de la Musique, une des plus prestigieuses récompenses musicales en France.', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/playlist/37i9dQZF1DZ06evO0o1TI4?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(19, 'Boygenius', './assets/img/artistes/boygenius.jpg', '2024-07-07 21:00:00', 'Composé de Julien Baker, Phoebe Bridgers et Lucy Dacus - trois auteurs-compositeurs-interprètes qui mènent déjà chacun une carrière solo couronnée de succès - le supergroupe indie boygenius met en valeur l\'esprit de Dacus, le style émotionnellement actif de Baker, le lyrisme sombrement confessionnel de Bridgers et la magie de la collaboration qui s\'opère lorsque les trois s\'unissent. Après avoir sorti son premier EP éponyme en 2018, le groupe est revenu en 2023 avec son premier album complet, The Record, récompensé par un Grammy, et un EP intitulé The Rest. \r\n\r\nLe travail sur les productions solo respectives a pris la priorité pendant un certain temps, mais en mars 2023, Boygenius a sorti son premier album complet. Écrit à la fois séparément et ensemble, The Record a été enregistré au cours d\'un séjour intense d\'un mois au studio Shangri-La de Rick Rubin. L\'album qui en résulte, qui s\'est classé quatrième au Billboard 200, présente un front uni, les voix des trois auteurs-compositeurs s\'unissant pour créer un disque puissant, accrocheur et légèrement doux-amer. Le trio a ensuite entamé une tournée, jouant devant un public plus nombreux que jamais et remplissant même le Madison Square Garden. En octobre, Boygenius a sorti un EP de quatre chansons intitulé the rest, qui les a vus revisiter le genre de son plus folk et moins produit qu\'ils avaient commencé à jouer. En novembre, The Record est nommé sept fois aux Grammy Awards et remporte le prix du meilleur album de musique alternative, ainsi que ceux de la meilleure chanson rock et de la meilleure performance rock pour la chanson \"Not Strong Enough\". ~ Fred Thomas', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/playlist/37i9dQZF1DZ06evO0HwaBO?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(20, 'Ziak', './assets/img/artistes/ziak.jpg', '2024-07-07 22:00:00', 'Ziak est un rappeur français né en 1999. Il s\'est fait connaître en 2017 avec sa série de freestyles \"Encore\" sur YouTube, qui a rapidement attiré l\'attention de plusieurs médias et labels.\r\n\r\nDepuis lors, Ziak a sorti plusieurs projets, notamment les mixtapes \"Dans ma bulle\" en 2018 et \"Rockstar\" en 2019, ainsi que son premier album studio \"Lost in Paris\" en 2021. Sa musique est souvent décrite comme du rap mélancolique et introspectif, avec des influences de trap et de cloud rap.\r\n\r\nZiak est également connu pour sa voix grave et émouvante, ainsi que pour ses paroles honnêtes et personnelles sur des thèmes tels que l\'amour, la solitude et la dépression. Il a collaboré avec plusieurs artistes français, notamment Niska, SCH et Hamza.\r\n\r\nEn 2021, Ziak a été nommé aux Victoires de la Musique dans la catégorie Révélation masculine de l\'année.', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/playlist/37i9dQZF1DZ06evO1qionu?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>'),
(21, 'Twenty One Pilots', './assets/img/artistes/twenty-one-pilots.jpg', '2024-07-07 23:00:00', 'Twenty One Pilots, groupe récompensé par un Grammy Award, a fait évoluer la musique et la culture grâce à une vision en constante évolution. Le duo de Columbus, OH, composé de Tyler Joseph et Josh Dun, a enregistré plus de 34 milliards de streams dans le monde, vendu quatre millions de billets dans le monde entier, obtenu des dizaines de certifications multi-Platine et a même décroché une place dans le Livre Guinness® des records. Leur album Blurryface, quadruple disque de platine, a pris son envol en tant que \"premier album à obtenir une certification RIAA Gold ou Platinum pour chacune de ses chansons\", tandis que Vessel a suivi le mouvement et obtenu la même distinction. Le groupe s\'est élevé au rang de \"l\'un des 18 artistes à obtenir plusieurs certifications Diamant de la RIAA\", avec les titres \"Stressed Out\" et \"Heathens\". L\'album Trench, certifié platine en 2018, a produit des singles multiplatines et platines : \"Chlorine\", \"My Blood\" et \"Jumpsuit\", nommé aux GRAMMY® Awards. Ils ont suivi Trench avec leur album Scaled And Icy, certifié or, qui s\'est hissé à la première place du Top Rock Albums et du Top Alternative Albums du Billboard et s\'est retrouvé dans le Top 3 du Billboard 200. Au-delà des concerts en tête d\'affiche dans les arènes et les festivals du monde entier, Twenty One Pilots a notamment construit un monde immersif, à l\'origine d\'un arc conceptuel de plusieurs albums à travers Blurryface, Trench, Scaled And Icy, et complétant cette histoire sur leur septième album complet, Clancy, qui a marqué la plus grande semaine pour un album de rock en 2024 et la quatrième entrée consécutive du groupe dans le Top 3 du Billboard 200.', '<iframe style=\"border-radius:12px\" src=\"https://open.spotify.com/embed/playlist/37i9dQZF1DZ06evO2k3tf2?utm_source=generator&theme=0\" width=\"100%\" height=\"152\" frameBorder=\"0\" allowfullscreen=\"\" allow=\"autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture\" loading=\"lazy\"></iframe>');

